import React from "react";
import { Container } from "react-bootstrap";

const Footer = () => {
  return (
    <>
      <Container
        fluid
        style={{
          paddingTop: "5rem",
          backgroundColor: "#2D2828",
          width: 1577,
          height: 500,
          textAlign: "center",
          fontFamily: "primary-font",
          color: "white",
        }}
      ></Container>
    </>
  );
};

export default Footer;
